import React, { Component } from 'react';
import { Box, Button, Paragraph, RangeInput } from 'grommet';

class Header extends Component {
	state = {
		arrayRange: 10
	};
	render() {
		return (
			<Box
				direction="row"
				gap="xlarge"
				pad={{ vertical: 'medium', left: 'xlarge' }}
				background="brand"
				elevation="small"
			>
                <Box direction="row">
                <Button>Generate New Array</Button>
                </Box>
                
			</Box>
		);
	}
}

export default Header;
